<template>
    <div class="" ref="qrCodeLogin"></div>
</template>

<script setup>
import {ref, onMounted} from 'vue';
import QRCodeStyling from 'qr-code-styling';

const props = defineProps(
    {
        qrData: String,
        generationMethod: Function,
    })

const options = {
    width: 300,
    height: 300,
    type: 'svg',
    data: props.qrData,
    image: 'data:image/svg+xml;base64,',
    margin: 0,
    qrOptions: {
        typeNumber: 0,
        mode: 'Byte',
        errorCorrectionLevel: 'H',
    },
    imageOptions: {
        imageSize: 0.2,
        margin: 2,
        crossOrigin: 'anonymous',
    },
    dotsOptions: {
        type: "square",
        color: '#000',
    },
    cornersSquareOptions: {
        color: '#000',
        type: 'square',
    },
    cornersDotOptions: {
        color: '#000',
        type: 'square',
    },
};
const qrCodeLogin = ref(new QRCodeStyling(options));

const qrCodeInstance = new QRCodeStyling(options);

const updateQRCode = (option) => {
    options.data = option
    qrCodeInstance.update(options)
};

const extensionDownload = (str) => {
    if (str) qrCodeInstance.download({extension: str});
};

defineExpose({
    extensionDownload,
});

onMounted(() => {
    options.data = props.qrData
    qrCodeInstance.append(qrCodeLogin.value);
    if (props.generationMethod) props.generationMethod(updateQRCode);
})

</script>

